import { apiGet, apiPost } from '../../shared/utils/apiUtils';

export interface Question {
  id: number;
  question: string;
}

export interface QAAnswer {
  question_id: number;
  answer: string;
}

export const qaApi = {
  async getQuestions() {
    return apiGet<Question[]>('/qa/questions');
  },
  async saveAnswers(answers: QAAnswer[]) {
    return apiPost('/qa/answers', { answers });
  }
};
